  //const myElement = useRef(null);
  const next = useNavigate();
  function submitfn() {
    var startLocation = ((document.getElementById("start") as HTMLInputElement).value);
    var endLocation = ((document.getElementById("end") as HTMLInputElement).value);
    console.log(startLocation,endLocation);
    fetchData();
  }
  async function fetchData() {
    if (startval) {
      console.log(startval);

      setstartval("");

      
    } else {
      alert("startval Cannnot be blank");
    }
    const response = await fetch("http://127.0.0.1:5000/hello"+"?start="+startval+"&end="+endval, {
      mode: 'cors'
    });
    const json = await response.json();
    setData(json);
    console.log(json);

    next('/output',{state:json});
  }
    return <div>Home
              <input id="prompt" type="text" placeholder="Enter prompt"  value={startval} onChange={(e) => setstartval(e.target.value)}/>
              <button onClick={submitfn} type="submit">Get Image</button>

        <button onClick={() => { next("/output") }}>lsitingpage</button>
